import Flicking from '@egjs/react-flicking';
import '../align.css';

const Carousel = () => {

    return (
        <div class="iphone">

            <div className="container">
                <Flicking className="flicking flicking0" gap={10} circular={true} moveType="freeScroll" moveType={{ type: "snap", count: 1 }}
                    autoResize={true}>
                    <div className="panel">
                        <div>
                            <img width="50%" src="https://picsum.photos/800/600?random=1" />
                            <div>heck</div>
                        </div>
                    </div>
                    <div className="panel">
                        <img width="50%" src="https://picsum.photos/800/600?random=2" />
                    </div>
                    <div className="panel">
                        <img width="50%" src="https://picsum.photos/800/600?random=3" />
                    </div>
                    <div className="panel" />
                    <div className="panel" />
                    <div className="panel" />
                    <div className="panel" />
                    <div className="panel" />
                </Flicking >
            </div >
        </div>
    );

};

export default Carousel;
